import React, { Fragment } from 'react';
import { NavLink } from 'react-router-dom';
import SearchBox from './SearchBox';
// import 'bootstrap/dist/css/bootstrap.css';



const Navbar = () => {
  const Sidebar = document.getElementById("mySidebar");
 const w3_open = () => {
    if (Sidebar.style.display === "block") {
      Sidebar.style.display = "none";
    } else {
      Sidebar.style.display = "block";
    }
  }
  
  // Close the sidebar with the close button
  const w3_close = () => {
    Sidebar.style.display = "none";
  }

  return (
    <Fragment>
      <div class="w3-top">
  <div class="w3-bar w3-white w3-card" id="myNavbar">
    <a href="/" class="w3-bar-item w3-button w3-wide">LANK"S FREE</a>
    
    <div class="w3-right w3-hide-small">
    <NavLink exact to="/about" onClick={w3_close} class="w3-bar-item w3-button">ABOUT</NavLink>
      <a href="#team" class="w3-bar-item w3-button"><i class="fa fa-user"></i> TEAM</a>
      <a href="#work" class="w3-bar-item w3-button"><i class="fa fa-th"></i> WORK</a>
      <a href="#pricing" class="w3-bar-item w3-button"><i class="fa fa-usd"></i> PRICING</a>
      <a href="#contact" class="w3-bar-item w3-button"><i class="fa fa-envelope"></i> CONTACT</a>
    </div>
  

    <a href="javascript:void(0)" class="w3-bar-item w3-button w3-right w3-hide-large w3-hide-medium" onClick={w3_open}>
      <i class="fa fa-bars"></i>
    </a>
  </div>
</div>


<nav class="w3-sidebar w3-bar-block w3-black w3-card w3-animate-left w3-hide-medium w3-hide-large" style={{display:"none" }} id="mySidebar">
  <a href="javascript:void(0)" onClick={w3_close}  class="w3-bar-item w3-button w3-large w3-padding-16">Close Ã—</a>
  <NavLink exact to="/about" onClick={w3_close} class="w3-bar-item w3-button">ABOUT</NavLink>
  <a href="#team" onClick={w3_close} class="w3-bar-item w3-button">TEAM</a>
  <a href="#work" onClick={w3_close} class="w3-bar-item w3-button">WORK</a>
  <a href="#pricing" onClick={w3_close} class="w3-bar-item w3-button">PRICING</a>
  <a href="#contact" onClick={w3_close} class="w3-bar-item w3-button">CONTACT</a>
</nav>
     <nav className="navbar navbar-expand-md bg-dark navbar-dark" style={{paddingBottom:"9px"}}>
  <a className="navbar-brand" href="/">LANG's FREE</a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsibleNavbar">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="collapsibleNavbar">
   
     <ul className="navbar-nav">
              {/* <li className="nav-item"><NavLink className="nav-link" exact to="/home">Home</NavLink></li> */}
              <li className="nav-item"><NavLink className="nav-link" exact to="/services">Service</NavLink></li>
              <li className="nav-item"><NavLink className="nav-link" exact to="/about">About Us</NavLink></li>
              <li className="nav-item"><NavLink className="nav-link" exact to="/portfolio">Porfolio</NavLink></li>
              <li className="nav-item"><NavLink className="nav-link" exact to="/pricing">Pricing</NavLink></li>
              <li className="nav-item"><NavLink className="nav-link" exact to="/contact">Contact Us</NavLink></li>
              <li className="nav-item"><NavLink className="nav-link" exact to="/signup">Sign In</NavLink></li>
            </ul>
  </div> 
  <div className="searchBox" >
  <SearchBox />
  </div>
</nav>
    </Fragment>
  );
}

export default Navbar;
